#include <stdio.h>

// Função para ordenar os dígitos de um número
int ordenarDigitos(int num) {
    int count[10] = {0}; // Contador para cada dígito de 0 a 9
    int result = 0;

    // Conta a ocorrência de cada dígito no número
    while (num > 0) {
        int digit = num % 10;
        count[digit]++;
        num /= 10;
    }

    // Constrói o número resultante com os dígitos ordenados
    for (int i = 0; i < 10; i++) {
        for (int j = 0; j < count[i]; j++) {
            result = result * 10 + i;
        }
    }

    return result;
}

